//Class with homepage.
const Home = () => {

    const handleClick = (e) => {
        console.log('hello bruv', e);
    }

    const handClickAnon = (name, e) => {
        console.log('ello bruv' + ' ' + name + e);
    }

    return ( 
        <div className="home">
            <h2>Homepage</h2>
            <button onClick={handleClick}>Click</button>
            <button onClick={(e) => console.log(handClickAnon('goodday', e))}>Hi</button>
        </div>
     );
}
 
export default Home;
